import React, { useState, useEffect } from 'react';
import ArticleSelectorFlex from './ArticleSelector';

export default function CategoryVegetables ({articles, shoppingListIdState, amounts, category}) {

    const fruit = articles.filter((article) => article.articlecategory === "1");

    const randomAmount = Math.floor(Math.random() * 4);

    return (
        <div>
            {fruit.map((someFruit) =>
                <ArticleSelectorFlex 
                    key={fruit.id}
                    description={fruit.articledescription}
                    amount={randomAmount}>
            </ArticleSelectorFlex>)}
        </div>
    )

}
